const ProjectList = ({projects}) => {


  return (
    <div>
    {projects.map(project => {
    <div>
    <label>{project.name}</label>
    <p>{project.description}</p>
    <p>{project.tool}</p> 
    </div>})}
    </div>
  )
}

export default ProjectList;
